import React from "react";

class TodoTerminal extends React.Component {

    render() {
        const products = this.props.products;
        console.log(products);
        return(
            <div id="todoterminal">
                <div>
                    <span>Cashier info</span>
                    <button>Transactions's Manu</button>
                </div>                
                <div>
                    <table>
                        <thead>
                            <tr>
                                <th>Barcode</th>
                                <th>Product Name</th>
                                <th>Supplier_Name</th>
                                <th>Product count</th>
                                <th>Price</th>
                            </tr>
                        </thead>
                         <tbody>
                             {
                                 products.map(item =>{
                                    
                                     return (
                                        <tr  key={item.key}>
                                            <td>
                                                <input
                                                    type="text" 
                                                    value = {item.barcode} 
                                                    onChange={(e)=>{this.props.handleBarcodeInput(item.key,e)}}
                                                />
                                            </td>
                                            <td></td>
                                            <td></td>
                                            <td>
                                                <input 
                                                    type="number" 
                                                    min= '1' 
                                                    value = {item.count}
                                                    onChange ={(e)=> {this.props.inputProductCount(item.key,e)}}
                                                />
                                            </td>
                                            <td></td>
                                        </tr>
                                    );
                                })
                            }
                            
                        </tbody>
                    </table>
                    <div>
                        <span>Amount</span>
                        <span></span>
                    </div>
                    <div>
                        <div>
                            <span>Given money</span>
                            <input 
                                type="text" 
                                onChange = {this.props.inputGivenMoney}
                            />
                        </div>
                        <div>
                            <span>Change</span>
                            <input type="text"/>
                        </div>
                    </div>
                </div>              
                <button onClick = {this.props.transactionDone} >Done</button>           
            </div>
        );
    }
}

export default TodoTerminal;
